import React from 'react';
import sampleWritingTestResults from '../../utils/sampleWritingTestResults';
import AnswerRow from './components/AnswerRow';
class WritingPage extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      sampleAnswers: sampleWritingTestResults,
      writingPageModalOpen: false,
    }
  };


  render() {
    const { sampleAnswers } = this.state;
    return(
      <div className="slide">
      <div className="row">
        <div className="col s12 l4">
          <ol className="answers-list">
           <AnswerRow sampleAnswers={sampleAnswers}/>
            </ol>
            </div>
            </div>
            </div>
    )
  }
}

export default WritingPage;
